import React, { Component } from 'react'
import {Link} from 'react-router-dom';
import { Input } from 'antd';

// import logohihi from '../images/logo5.png';
const { Search } = Input;
const Navbar = ({toggle}) =>{

const onSearch = value => console.log(value);
        return (
                <nav className='navbar-card'
                role='navigation'
                // style={{height:'5rem',padding:'2rem', background:'grey'}}
                >
                    <Link to='/' className='2xl:pl-32 md:pl-8'>
                        {/* <img src={logohihi} alt="logo" /> */}
                        Grover
                    </Link>
                    <div className="px-4 cursor-pointer md:hidden" onClick={toggle}>
                    <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" /></svg>
                    </div>
                    <div className="pr-8 md:block hidden">
                        <Link className='p-4' to='/'>Home</Link>
                        <Link className='p-4' to='/menu'>Menu</Link>
                        <Link className='p-4' to='/about'>Service</Link>
                        <Link className='p-4' to='/contact'>Shop</Link>
                    </div>
                    <div>
                    <Search placeholder="input search text" allowClear onSearch={onSearch} style={{ width: 200 }} />
                    </div>
                </nav>

        )
    };
export default Navbar;
